import { Link } from 'react-router-dom';
import './Navbar.css';

const Navbar = () => {
    return (
        <nav className="navbar">
            <NavLink to="/stressometer" className="nav-link" activeClassName="active-link">Stressometer</NavLink>
            <NavLink to="/doctorai" className="nav-link" activeClassName="active-link">DoctorAI</NavLink>
            <NavLink to="/recommend" className="nav-link" activeClassName="active-link">Recommend a Psychiatrist</NavLink>
            <NavLink to="/blog" className="nav-link" activeClassName="active-link">Blog</NavLink>
        </nav>
    );
};

export default Navbar;
